import React from "react"
export default function TopListReducer(toplist={   //状态管理函数，来管理榜单数据
    data:{
        Updata:{},
        Newdata:{},
        Orgdata:{}
    }
},action){
    if(action.type==="topListUp_data"){
        return data.Updata=action.data
    }else if(action.type==="topListNew_data"){
        return data.Newdata=action.data
    }else if(action.type==="topListOrg_data"){
        return data.Orgdata=action.data
    }else{
        return toplist;
    }
}
